import './SelectFlight.css';
import React from 'react';
import { connect } from 'react-redux';

const SelectFlight = (props) => {
    return (
        <div className="SelectFlightContainer">
            <div className="SelectedFlight"></div>
            <div className="controls">
                <div>Passengers</div>
                <div>Bags</div>
                <div>Carry-Ons</div>
                <div>Class</div>
                <div>Price</div>
            </div>
            <button>Book</button>
        </div>
    )
}

const mapStateToProps = state = {
    selFlight: state.SelectFlight
}

export default connect(mapStateToProps)(SelectFlight);
